function App(){

    const comments = [
        {id: 1, text:' comment 1'},
        {id: 2, text: 'comment 2'},
        {id: 3, text: 'comment 3'},
    ]

    return (
       <div className="container">
         <h3>Comments ({comments.length})</h3>
         <ul>
           {comments.map((cmt,index) =>(
               <li>{cmt.text}</li>
           ))}
         </ul>
       </div>
    )
}

export default App
